My primary goal with our @eltmethod coaching clients is to make them feel safe, seen, and heard. 

This means not only providing them with exceptional customer service that includes prompt, reliable turnaround times and high quality programs, but also effective communication. This isn’t about coddling people or being “soft” on them; it’s about establishing a trusting relationship that empowers the individual to succeed. 👊

Even though I’m not taking on new clients myself, I have a team of coaches who have been hand-picked, trained, and overseen by me to deliver the best experience. 

Here are my coaches and the client populations they work with: 

@lauren.j.avery - pregnant and postpartum clients as well as those trying to conceive (TTC)
@fittie_or_foodie - those who want to build confidence in the gym by pushing their bodies outside their comfort zone to reach their goals 
@tara.hux - former athletes, healthcare workers/professionals with odd or long hours, and anyone who has a fun personality 
@rpendakur - individuals looking to conquer their physique/performance goals with a focus on lasting behavior change 
@natalie_fay__ - busy individuals looking to get stronger and build a healthy, lasting relationship with nutrition and exercise 

Sign up for online coaching at ELTMethod.com or the link in my bio. 🤗

